import React from 'react';
import './MoneyTransfer.css'; // Add CSS styles here
import scanPayIcon from '../../assets/icons/Scan & Pay.png';
import mobileContactIcon from '../../assets/icons/To Mobile or Contact.png';
import bankAccountIcon from '../../assets/icons/To Bank A/c or UPI ID.png';
import selfAccountIcon from '../../assets/icons/To Self A/c.png';
import balanceHistoryIcon from '../../assets/icons/Balance & History.png';
import splitBillsIcon from '../../assets/icons/Split Bills.png';
import receiveMoneyIcon from '../../assets/icons/Receive Money.png';
const MoneyTransfer = () => {
  return (
    <div className="money-transfer-container">
      {/* Header */}
      <div className="header">
        <h1></h1>
      </div>

      {/* Money Transfer Section */}
      <div className="money-transfer-section">
        <h2>Money Transfer</h2>
        <div className="transfer-icons">
          <div className="icon">
            <img src="scan-icon.png" alt="Scan & Pay" />
            <p>Scan & Pay</p>
          </div>
          <div className="icon">
            <img src="mobile-icon.png" alt="To Mobile or Contact" />
            <p>To Mobile or Contact</p>
          </div>
          <div className="icon">
            <img src="bank-icon.png" alt="To Bank A/c or UPI ID" />
            <p>To Bank A/c or UPI ID</p>
          </div>
          <div className="icon">
            <img src="self-icon.png" alt="To Self A/c" />
            <p>To Self A/c</p>
          </div>
          <div className="icon">
            <img src="history-icon.png" alt="Balance & History" />
            <p>Balance & History</p>
          </div>
          <div className="icon">
            <img src="split-icon.png" alt="Split Bills" />
            <p>Split Bills</p>
          </div>
          <div className="icon">
            <img src="receive-icon.png" alt="Receive Money" />
            <p>Receive Money</p>
          </div>
        </div>
      </div>

      {/* Footer Navigation */}
      <div className="footer-navigation">
        <div className="nav-item">Track Expenses</div>
        <div className="nav-item">Home</div>
        <div className="nav-item">Loans</div>
      </div>
    </div>
  );
};

export default MoneyTransfer;
